import React from 'react';
import {Box, Button, Center, Flex, Input, Stack} from "@chakra-ui/react";

const Home = () => {
    return (
        <Box bg={'#F7FAFC'} minHeight={'100vh'}>

                <Stack m={4} bg={'white'} p={'100px'} direction={'row'} maxW={'800px'} >
                    <Input placeholder={'Enter a join code'}/>
                    <Button>Join</Button>
                </Stack>

        </Box>
    );
};

export default Home;
